CREATE DATABASE IF NOT EXISTS `monitorx`;

USE `monitorx`;

DROP TABLE IF EXISTS `m_comment`;

CREATE TABLE `m_comment` (
  `m_id` int(11) NOT NULL AUTO_INCREMENT,
  `m_u_id` int(11) NOT NULL,
  `m_desc` varchar(200) NOT NULL,
  `m_submit_date` datetime NOT NULL,
  PRIMARY KEY (`m_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_crm2`;

CREATE TABLE `m_crm2` (
  `c_id` int(11) NOT NULL AUTO_INCREMENT,
  `c_pa_node_id` varchar(200) NOT NULL,
  `c_act_request_id` varchar(200) NOT NULL,
  `c_cust_name` varchar(200) NOT NULL,
  `c_product_name_pa` varchar(200) NOT NULL,
  `c_bandwidth_pa` varchar(200) NOT NULL,
  `c_type` varchar(100) NOT NULL,
  `c_pic` varchar(200) NOT NULL,
  `c_ptl` varchar(200) NOT NULL,
  `c_sbu_owner` varchar(200) NOT NULL,
  `c_sbu_region` varchar(200) NOT NULL,
  `c_service_id` varchar(200) NOT NULL,
  `c_owner` varchar(200) NOT NULL,
  `c_address` text NOT NULL,
  `c_created_date` datetime NOT NULL,
  `c_dispo_date` datetime DEFAULT NULL,
  `c_bai_date` date DEFAULT NULL,
  PRIMARY KEY (`c_id`),
  UNIQUE KEY `c_pa_node_id` (`c_pa_node_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1281 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_crm3`;

CREATE TABLE `m_crm3` (
  `c_id` int(11) NOT NULL AUTO_INCREMENT,
  `c_pa_node_id` varchar(200) NOT NULL,
  `c_act_request_id` varchar(200) NOT NULL,
  `c_cust_name` varchar(200) NOT NULL,
  `c_product_name_pa` varchar(200) NOT NULL,
  `c_bandwidth_pa` varchar(200) NOT NULL,
  `c_type` varchar(100) NOT NULL,
  `c_pic` varchar(200) NOT NULL,
  `c_ptl` varchar(200) NOT NULL,
  `c_sbu_owner` varchar(200) NOT NULL,
  `c_sbu_region` varchar(200) NOT NULL,
  `c_service_id` varchar(200) NOT NULL,
  `c_owner` varchar(200) NOT NULL,
  `c_address` text NOT NULL,
  `c_created_date` datetime NOT NULL,
  `c_created2_date` datetime DEFAULT NULL,
  `c_dispo_date` datetime DEFAULT NULL,
  `c_bai_date` date DEFAULT NULL,
  PRIMARY KEY (`c_id`),
  UNIQUE KEY `c_pa_node_id` (`c_pa_node_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1118 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_kategori`;

CREATE TABLE `m_kategori` (
  `k_id` int(11) NOT NULL AUTO_INCREMENT,
  `k_desc` varchar(200) NOT NULL,
  PRIMARY KEY (`k_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_popr`;

CREATE TABLE `m_popr` (
  `no_pa` varchar(200) NOT NULL,
  `no_pr` varchar(200) NOT NULL,
  `nilai_pr` bigint(20) NOT NULL,
  `no_po` varchar(200) NOT NULL,
  `nilai_po` bigint(20) NOT NULL,
  `no_gr` varchar(200) NOT NULL,
  `nilai_gr` bigint(20) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_ppi`;

CREATE TABLE `m_ppi` (
  `ppi_id` int(11) NOT NULL AUTO_INCREMENT,
  `ppi_project_id` int(11) NOT NULL,
  `ppi_no_instalasi` varchar(200) NOT NULL,
  `ppi_vendor` int(11) NOT NULL,
  `ppi_tgl_mulai` date DEFAULT NULL,
  `ppi_tgl_survey` date DEFAULT NULL,
  `ppi_tgl_foc` date DEFAULT NULL,
  `ppi_tgl_tc` date DEFAULT NULL,
  `ppi_tgl_soft` date DEFAULT NULL,
  `ppi_tgl_aset` date DEFAULT NULL,
  `ppi_tgl_final` date DEFAULT NULL,
  `ppi_tgl_order` datetime DEFAULT NULL,
  `ppi_keterangan` text NOT NULL,
  `ppi_io_number` varchar(200) NOT NULL,
  `ppi_attachment` varchar(200) NOT NULL,
  `ppi_by_ptl` int(11) NOT NULL,
  `ppi_status` int(11) NOT NULL COMMENT '0:unread, 1:forwarded, 2:closed',
  PRIMARY KEY (`ppi_id`)
) ENGINE=InnoDB AUTO_INCREMENT=133 DEFAULT CHARSET=latin1;

