DROP TABLE IF EXISTS `m_project`;

CREATE TABLE `m_project` (
  `p_id` int(11) NOT NULL AUTO_INCREMENT,
  `p_c_id` int(11) NOT NULL,
  `p_nilai_po` bigint(20) DEFAULT NULL,
  `p_nilai_pr` bigint(20) DEFAULT NULL,
  `p_nilai_gr` bigint(20) DEFAULT NULL,
  `p_bai_date` varchar(200) DEFAULT NULL,
  `p_closed_date` datetime DEFAULT NULL,
  `p_status` int(11) NOT NULL,
  `p_v_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`p_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1281 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_status`;

CREATE TABLE `m_status` (
  `s_id` int(11) NOT NULL AUTO_INCREMENT,
  `s_code` int(11) NOT NULL,
  `s_desc` varchar(200) NOT NULL,
  `s_progress` varchar(50) NOT NULL,
  `s_progress_value` decimal(6,2) NOT NULL,
  PRIMARY KEY (`s_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_user`;

CREATE TABLE `m_user` (
  `u_id` int(11) NOT NULL AUTO_INCREMENT,
  `u_name_crm` varchar(200) NOT NULL,
  `u_name` varchar(200) NOT NULL,
  `u_email` varchar(200) NOT NULL,
  `u_password` varchar(200) NOT NULL,
  `u_level` int(11) NOT NULL,
  `u_wilayah` int(11) DEFAULT NULL,
  `u_active` int(11) NOT NULL DEFAULT '1',
  PRIMARY KEY (`u_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS `m_vendor`;

CREATE TABLE `m_vendor` (
  `v_id` int(11) NOT NULL AUTO_INCREMENT,
  `v_name` varchar(200) NOT NULL,
  `v_pic` varchar(200) NOT NULL,
  `v_pic_telp` varchar(200) NOT NULL,
  `v_email` text NOT NULL,
  PRIMARY KEY (`v_id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=latin1;

